let FilterFood = () => {
    return (
        <div className="filter-area">
            <select name="type">
                <option value="all">All</option>
                <option value="vegan">Vegan</option>
                <option value="vegetarian">Vegetarian</option>
                <option value="meat">Meat</option>
            </select>
        </div>
    );
}

export default FilterFood;
